We are grateful we were able to perform at least one day this weekend for you, New York. 💪🏼 We enjoyed showcasing the pride, precision and professionalism of your United States Air Force. 

Our next stop is back home to Las Vegas to help us prepare for our next trip to Cheyenne, Wyoming! 🤠 Stay tuned to our social media channels for Thunderbirds news and photo/video content!

@greaterbinghamtonairport @airmanmagazine @usairforce @usaf_recruiting

